UML:TaggedValue.value:
このシーケンスフローで遷移可能か否かを判定する。  遷移可能かの判断は、{@link FlowProceedCondition}により判断する。 遷移条件({@link FlowProceedCondition})が指定されていない場合には、常に遷移可能(true)を返す。 
@see FlowProceedCondition
@return 進行可能の場合はtrue

タスクに割り当てられた担当グループを取得する。
<p/> 担当グループは、実行順でソートされて返却される。 
@return 担当グループ

タスクに割り当てられた担当ユーザを取得する。
<p/> 担当ユーザは、実行順でソートされて返却される。 
@return 担当ユーザ

{@inheritDoc}
<p/> {@code executor} に指定されたグループのアクティブタスクを完了させ、シーケンシャルタイプの場合は、実行順が次のユーザ/グループのアクティブタスクを作成する。 その後、 {@link please.change.me.workflow.condition.CompletionCondition#isCompletedGroupTask(Map, String, Task)} を評価してその結果を返却する。 
@return 次のフローノードにワークフローを進行させて良い場合は {@code true}

{@inheritDoc}
<p/> {@code executor} に指定されたユーザのアクティブタスクを完了させ、シーケンシャルタイプの場合は、実行順が次のユーザのアクティブタスクを作成する。 その後、 {@link please.change.me.workflow.condition.CompletionCondition#isCompletedUserTask(Map, String, Task)} を評価してその結果を返却する。 
@return 次のフローノードにワークフローを進行させて良い場合は {@code true}

{@inheritDoc}
<p/> 比較対象の {@link TaskAssignedGroupEntity#getExecutionOrder()} がフィルタ対象の実行順より大きい値を返す場合 {@code true} 
@return フィルタ対象よりも比較対象の実行順が大きい場合 {@code true}

ワークフローIDに紐づく適用期間内のワークフロー定義を取得する。
<p/> 適用期間内に複数のワークフロー定義情報が存在していた場合には、 バージョン番号が最大のワークフロー定義情報を返却する。 
@return ワークフロー定義

{@inheritDoc}
<p/> 比較対象の {@link TaskAssignedUserEntity#getExecutionOrder()} がフィルタ対象の実行順より大きい値を返す場合 {@code true} 
@return フィルタ対象よりも比較対象の実行順が大きい場合 {@code true}
